import axios from "axios";

const API_BASE_URL = "http://localhost:8080/api;";


class PartService {
    getAllParts() {
        return axios.get(`${API_BASE_URL}/parts`);
    }
    createPart(partData) {
        return axios.post(`${API_BASE_URL}/parts`, partData);
    }
}
export default new PartService();
